import Login from "./components/login";
import Table from "./components/table";
import Leer from "./components/leer";
import {Route, Routes} from "react-router-dom";


function App() {

    return (
        <div className="App">
            <Routes>
                <Route path='/' element={<Login />}/>
                <Route path="/Leer" element={<Leer/>} />
            </Routes>
        </div>
    );
}

export default App;
